  false,\n\t\"url\": null,\n\t\"notes\": \"This report contains locations and water
  use at Ouray NWR for 2013. The document begins with a Hatchery water use report/management
  plan, providing more detailed information on fishery operations. Next a summary
  of water rights concerning Ouray NWR is presented, followed by a brief description
  of operations and conditions for the year. Water use for each feature were then
  discussed in detail before providing tabulated data portraying the total water uses
  for each feature, the water sources that were used, and the pump use.\",\n\t\"owner_org\":
